  false,\n\t\"url\": null,\n\t\"notes\": \"NSP Action Plans, also known as Substantial
  Amendments, contain a description of a granteeu2019s intended use for NSP funds.
  The plans contain information on the following topics: the areas of greatest need
  for NSP funding, the distribution and use of funds, program definitions and descriptions,
  low income targeting, public comment, and activity descriptions. Action Plans are
  submitted via the Disaster Recovery Grant Reporting (DRGR) System and reviewed and
  approved by HUD before posting.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
